import logo from './logo.svg';
import './App.css';
import { Button, Alert, Breadcrumb, BreadcrumbItem, Card } from 'react-bootstrap';
import './jufb-bootstrap.css'


function App() {
  return (
    <div className="App">
      <h1>JuFB</h1>
      <Breadcrumb>
        <BreadcrumbItem>Test 1</BreadcrumbItem>
        <BreadcrumbItem>Test 2</BreadcrumbItem>
        <BreadcrumbItem>Test 3</BreadcrumbItem>
      </Breadcrumb>
      <header className="App-header">
        <Card style={{ color:"#000", marginBottom: 150 }}>
          <Card.Title>Card Example</Card.Title>
          <Card.Text>This is an example of React Card.</Card.Text>
        </Card>
        <Alert variant="success">This is a button</Alert>
        <Button>Test Button</Button>
     </header>
    </div>
  );
}

export default App;
